import React from 'react';

const Cart = ({ cartPlaces, removeFromCart }) => {
  return (
    <div>
      <h2>Cart</h2>
      {cartPlaces.length === 0 ? (
        <p>Your cart is empty.</p>
      ) : (
        <ul>
          {cartPlaces.map((place) => (
            <li key={place.id}>
              {place.title} - {place.price}
              <button onClick={() => removeFromCart(place.id)}>Remove</button>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default Cart;
